public class Solution {
    public int MaximizeTheProfit(int n, IList<IList<int>> offers) {
        var dp = new int[n + 1];
        var events = new List<(int time, int start, int gold)>();

        foreach (var offer in offers) {
            events.Add((offer[1] + 1, offer[0], offer[2]));
        }

        events.Sort();

        foreach (var e in events) {
            for (int i = n; i >= e.time; i--) {
                dp[i] = Math.Max(dp[i], dp[e.start] + e.gold);
            }
        }

        return dp[n];
    }
}
